// File: client/src/pages/LandingPage.js
import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <div className="text-center py-20">
      <h1 className="text-5xl font-extrabold text-gray-800 mb-6">Welcome to BookMyService</h1>
      <p className="text-lg text-gray-600 mb-8">
        A multi-industry freelancing platform connecting professionals with clients.
      </p>
      <div className="space-x-4">
        <Link to="/register" className="bg-blue-500 text-white px-6 py-3 rounded-lg font-bold hover:bg-blue-600">
          Join as a Freelancer
        </Link>
        <Link to="/register" className="bg-green-500 text-white px-6 py-3 rounded-lg font-bold hover:bg-green-600">
          Hire a Professional
        </Link>
      </div>
      <div className="mt-12">
        <p className="text-gray-600">Already have an account?</p>
        <Link to="/login" className="text-blue-500 hover:underline">Sign in here</Link>
      </div>
    </div>
  );
};

export default LandingPage;
